import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
} from "antd";
import Link from "next/link";
import img1 from "../../public/16.png";
import { useDispatch } from 'react-redux'
import { useEffect } from "react";
import { fetchposts,updateSsid,updateBird,updatePost } from '../../store/actions/postAction'
const FormItem = Form.Item;

function setDataProfile() {
  const dispatch = useDispatch();
  useEffect(()=>{
    dispatch(fetchposts(""));
    dispatch(updateSsid(""));
    dispatch(updateBird(null));
    dispatch(updatePost(""));
  })
  return (
    <FormItem>
      <div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "center",
            }}
          >
            <h1 style={{ fontSize: "42px" }}>โปรดเลือกวิธีการระบุตัวตน</h1>
          </div>
          <div
            style={{
              flexDirection: "row",
              display: "flex",
              width: "100%",
            }}
          >
            <div
              style={{
                display: "flex",
                flexBasis: "auto",
                width: "100%",
                justifyContent: "center",
                alignItems: "center",
                margin: "10px",
                flexDirection: "column",
              }}
            >
              <Link href="/page.covid3" >
                <div
                  style={{
                    background: "white",
                    width: "220px",
                    height: "220px",
                    padding: "23px",
                    background: "#FFFFFF0A 0% 0% no-repeat padding-box",
                    borderRadius: "47px",
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    margin: "20px 40px",
                    cursor: "pointer",
                  }}
                >
                  <div
                    style={{
                      height: "50px",
                      width: "100%",
                      background:
                        "transparent linear-gradient(107deg, #E88300 0%, #EF5800 100%) 0% 0% no-repeat padding-box",
                      borderRadius: "146px",
                      display: "flex",
                      alignItems: "center",
                      justifyContent: "center",
                    }}
                  >
                    <div
                      style={{
                        width: "25px",
                        height: "31px",
                        background: "white",
                        borderRadius: "58px",
                        margin:"0px 4px"
                      }}
                    />
                    <div
                      style={{
                        width: "25px",
                        height: "31px",
                        background: "white",
                        borderRadius: "58px",
                        margin:"0px 4px"
                      }}
                    />
                    <div
                      style={{
                        width: "25px",
                        height: "31px",
                        background: "white",
                        borderRadius: "58px",
                        margin:"0px 4px"
                      }}
                    />
                    <div
                      style={{
                        width: "25px",
                        height: "31px",
                        background: "white",
                        borderRadius: "58px",
                        margin:"0px 4px"
                      }}
                    />
                    <div
                      style={{
                        width: "25px",
                        height: "11px",
                        background: "white",
                        borderRadius: "58px",
                        margin:"16px 4px 0px 4px"
                      }}
                    />
                  </div>
                </div>
              </Link>
              <h3 style={{ fontSize: "22px" }}>กำหนดเอง</h3>
            </div>

            <div
              style={{
                display: "flex",
                flexBasis: "auto",
                width: "100%",
                justifyContent: "center",
                alignItems: "center",
                margin: "10px",
                flexDirection: "column",
              }}
            >
              <div
                style={{
                  background: "white",
                  width: "220px",
                  height: "220px",
                  padding: "10px",
                  background: "#FFFFFF0A 0% 0% no-repeat padding-box",
                  borderRadius: "47px",
                  justifyContent: "center",
                  alignItems: "center",
                  display: "flex",
                  margin: "20px 40px",
                }}
              >
                <img src={img1} />
              </div>
              <h3 style={{ fontSize: "22px" }}>ระบุตัวตนด้วยใบหน้า</h3>
            </div>
          </div>
        </div>
      </div>
    </FormItem>
  );
}

export default setDataProfile;
